static int
format_decoder (const xtensa_insnbuf insn)
{
  if ((insn[0] & 0x8) == 0 && (insn[1] & 0) == 0)
    return 0; /* x24 */
  if ((insn[0] & 0xc) == 0x8 && (insn[1] & 0) == 0)
    return 1; /* x16a */
  if ((insn[0] & 0xe) == 0xc && (insn[1] & 0) == 0)
    return 2; /* x16b */
  if ((insn[0] & 0xf) == 0xe && (insn[1] & 0) == 0)
    return 3; /* fusion_format48 */
  if ((insn[0] & 0x1f) == 0xf && (insn[1] & 0x7f) == 0x40)
    return 4; /* fusion_format40 */
  if ((insn[0] & 0x1f) == 0xf && (insn[1] & 0x40) == 0)
    return 5; /* fusion_format_fir */
  if ((insn[0] & 0x1f) == 0xf && (insn[1] & 0x7f) == 0x41)
    return 6; /* fusion_format40_3 */
  return -1;
}

